print("```java\npackage org.apache.commons.cli;\n\nimport org.junit.jupiter.api.Test;\nimport java.util.Collection;\nimport java.util.Arrays;\nimport static org.junit.jupiter.api.Assertions.assertEquals;\n\npublic class AmbiguousOptionException_getMatchingOptions1Test {\n    private final AmbiguousOptionException exception = new AmbiguousOptionException(Arrays.asList(\"option1\", \"option2\"));\n\n    @Test\n    public void testGetMatchingOptions() {\n        Collection<String> expected = Arrays.asList(\"option1\", \"option2\");\n        Collection<String> actual = exception.getMatchingOptions();\n        assertEquals(expected, actual);\n    }\n}\n```")